import './App.css';
import Buyview from './buy_item';
import Marketview from './market';

import {
  BrowserRouter as Router,
  HashRouter,
  Route,
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Route path="/" exact component={Marketview}/>
      <Route path="/buy" exact component={Buyview}/>
    </Router>
  );
}

export default App;
